// components/Header.jsx
import { Link } from 'react-router-dom';

const Header = () => {
    // In a real app, you would check if user is authenticated
    const isAuthenticated = true; // Change this based on your auth state
    
    return (
        <header className="bg-amber-900 text-white shadow-md">
            <div className="container mx-auto px-4 py-4 flex justify-between items-center">
                <Link to="/" className="text-2xl font-bold">
                    COFEE2
                </Link>
                
                <nav className="hidden md:flex space-x-6">
                    <Link to="/" className="hover:text-amber-200 transition">Home</Link>
                    <Link to="/menu" className="hover:text-amber-200 transition">Menu</Link>
                    <Link to="/services" className="hover:text-amber-200 transition">Services</Link>
                    <Link to="/about" className="hover:text-amber-200 transition">About</Link>
                    <Link to="/contact" className="hover:text-amber-200 transition">Contact</Link>
                </nav>
                
                <div className="flex items-center space-x-4">
                    {isAuthenticated ? (
                        <Link to="/profile" className="flex items-center space-x-2 hover:text-amber-200 transition">
                            <span>My Profile</span>
                        </Link>
                    ) : (
                        <>
                            <Link to="/login" className="hover:text-amber-200 transition">Login</Link>
                            <Link to="/register" className="bg-amber-600 hover:bg-amber-700 px-3 py-1 rounded transition">
                                Register
                            </Link>
                        </>
                    )}
                </div>
            </div>
        </header>
    );
};

export default Header;
